document.addEventListener("DOMContentLoaded",function(){let a=document.querySelectorAll(".ce_serviceLink  .service-link-icon");if(a.length)for(let b=0,e=a.length;b<e;b++)a[b].addEventListener("click",function(a){a.preventDefault(),a.stopImmediatePropagation();let b=a.target.closest(".ce_serviceLink").querySelector("a");b.hasAttribute("href")&&(window.location.href=b.getAttribute("href"))});let d=document.querySelectorAll(".ce_serviceLink");if(d.length)for(let c=0,f=a.length;c<f;c++)d[c].addEventListener("mouseenter",function(a){a.preventDefault(),a.stopImmediatePropagation(),a.target.style.cursor="pointer"})},!1)